import React, { useState, useEffect } from 'react';
import {
    TextField,
    Button,
    FormControl,
    InputLabel,
    Select,
    MenuItem,
    Paper,
    Typography,
    Alert,
    Snackbar,
    CircularProgress,
    Box
} from '@mui/material';
import axios from 'axios';

const API_URL = 'http://localhost:5001/api';

const EnrollmentForm = () => {
    const [formData, setFormData] = useState({
        name: '',
        age: '',
        email: '',
        phone: '',
        batchId: ''
    });

    const [batches, setBatches] = useState([]);
    const [loading, setLoading] = useState(false);
    const [success, setSuccess] = useState(false);
    const [error, setError] = useState('');

    useEffect(() => {
        fetchBatches();
    }, []);

    const fetchBatches = async () => {
        try {
            const response = await axios.get(`${API_URL}/batches`);
            setBatches(response.data);
        } catch (err) {
            setError('Failed to fetch batch times');
        }
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        setError('');
        setLoading(true);

        try {
            const response = await axios.post(`${API_URL}/enroll`, formData);
            if (response.data.success) {
                setSuccess(true);
                setFormData({
                    name: '',
                    age: '',
                    email: '',
                    phone: '',
                    batchId: ''
                });
            }
        } catch (err) {
            setError(err.response?.data?.error || 'Enrollment failed');
        } finally {
            setLoading(false);
        }
    };

    const handleChange = (e) => {
        setFormData({
            ...formData,
            [e.target.name]: e.target.value
        });
    };

    return (
        <Box sx={{ mt: 4, mb: 4 }}>
            <Paper elevation={3}>
                <Typography variant="h4" className="form-title">
                    Yoga Class Enrollment
                </Typography>
                
                <Typography variant="subtitle1" className="form-subtitle">
                    Join our yoga classes for better health and peace of mind
                </Typography>

                <Typography variant="h6" align="center" color="primary" gutterBottom>
                    Monthly Fee: â‚¹500
                </Typography>

                {error && (
                    <Alert severity="error" sx={{ mb: 2 }}>
                        {error}
                    </Alert>
                )}

                <form onSubmit={handleSubmit}>
                    <TextField
                        fullWidth
                        label="Full Name"
                        name="name"
                        value={formData.name}
                        onChange={handleChange}
                        required
                        className="form-field"
                    />

                    <TextField
                        fullWidth
                        label="Age"
                        name="age"
                        type="number"
                        value={formData.age}
                        onChange={handleChange}
                        required
                        helperText="Age must be between 18 and 65"
                        className="form-field"
                    />

                    <TextField
                        fullWidth
                        label="Email"
                        name="email"
                        type="email"
                        value={formData.email}
                        onChange={handleChange}
                        required
                        className="form-field"
                    />

                    <TextField
                        fullWidth
                        label="Phone"
                        name="phone"
                        value={formData.phone}
                        onChange={handleChange}
                        required
                        className="form-field"
                    />

                    <FormControl fullWidth className="form-field">
                        <InputLabel>Batch Time</InputLabel>
                        <Select
                            name="batchId"
                            value={formData.batchId}
                            onChange={handleChange}
                            required
                        >
                            {batches.map((batch) => (
                                <MenuItem key={batch.id} value={batch.id}>
                                    {batch.time_slot}
                                </MenuItem>
                            ))}
                        </Select>
                    </FormControl>

                    <Button
                        type="submit"
                        variant="contained"
                        color="primary"
                        fullWidth
                        disabled={loading}
                        className="submit-button"
                    >
                        {loading ? <CircularProgress size={24} /> : 'Enroll Now'}
                    </Button>
                </form>
            </Paper>

            <Snackbar
                open={success}
                autoHideDuration={6000}
                onClose={() => setSuccess(false)}
            >
                <Alert severity="success" sx={{ width: '100%' }}>
                    Enrollment successful! Welcome to our Yoga class.
                </Alert>
            </Snackbar>
        </Box>
    );
};

export default EnrollmentForm;
